__NUXT_JSONP__("/svet/stat/dzibutsko/ceny", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n){return {data:[{tabsLoad:{tabWhatToSee:c,tabPrice:c,tabPeople:c,tabTrip:c,tabContact:c,tabHotel:c,tabNeighboring:h,tabVideos:d,tabArticles:d,tabWallSockets:i,tabChains:d,tabFauna:1,tabFlora:d,tabFoods:d,tabBrands:d},place:[{tld:".dj",name:"Džibutsko",area:23200,population:988000,slug:j,id_continent:e,information_chatgpt:"\u003Cp\u003EDžibutsko, oficiálně nazývané Džibutská republika, je malým státem východně od Afriky. Má rozlohu pouze 23 200 kilometrů čtverečních a hranice s Eritreou na severu, Etiopií na západě a jihovýchodě a Somálskem na jihu.\u003C\u002Fp\u003E\n\u003Cp\u003EDžibutsko je známé jako jedna z nejžhavějších zemí na světě, kde teploty často přesahují 40°C. Země má však také velmi krásné a neobvyklé krajiny, včetně sopky Ardoukoba, slaných jezer a korálových útesů na pobřeží Rudého moře.\u003C\u002Fp\u003E\n\u003Cp\u003EDžibutsko má také bohatou historii a kulturu. Místní lidé se nazývají Afarové a mají své tradiční zvyky a rituály. V Džibutském hlavním městě Džibuti se nachází mnoho historických památek, včetně starých mešit a hrobek.\u003C\u002Fp\u003E\n\u003Cp\u003EJedním z hlavních průmyslových odvětví v Džibutsku je doprava a logistika, díky jeho strategické poloze na cestě mezi Evropou a Asii. Džibutský přístav je největším v Africe a těží z jeho polohy jako brány do Etiopie, která je největším vnitrozemským trhem v regionu.\u003C\u002Fp\u003E\n\u003Cp\u003EPokud plánujete návštěvu Džibutska, měli byste mít na paměti, že je to relativně chudý stát s nízkou úrovní turistické infrastruktury. Nicméně, místní lidé jsou velmi přátelští a ochotní pomoci. Pokud hledáte dobrodružství a neobvyklou cestu, Džibutsko by mohlo být pro vás tou pravou volbou.\u003C\u002Fp\u003E",money_prices:[{name:"Taxi (cena za km)",value:b,date_update:a},{name:"Hlavní jídlo",value:1500,date_update:a},{name:"Chleba",value:150,date_update:a},{name:"Mléko",value:k,date_update:a},{name:"Voda (500ml)",value:f,date_update:a},{name:"Espresso",value:f,date_update:a},{name:"Zmrzlina (jeden kopeček)",value:f,date_update:a},{name:"Pivo",value:k,date_update:a},{name:"Krabička cigaret",value:b,date_update:a},{name:"Big Mac",value:b,date_update:a},{name:"Coca Cola (500ml)",value:f,date_update:a}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:l,date_update:a},{name:"Policie",value:"17",date_update:a},{name:"Hasiči",value:l,date_update:a},{name:"Zdravotnická záchranná služba",value:"19",date_update:a}],phone_prefix:"+253",coordinates:[{latitude:"11.8251",longitude:"42.5903"}],people_religion:[{name:"islám",value:"94%"},{name:"křesťanství",value:"6%"}],people_nationality:[{name:"Somálci",value:"60%"},{name:"Afarové",value:"35%"},{name:"Jemenité",value:"1%"},{name:"Ostatní",value:"4%"}],visitors_entry:[{name:"Občanský průkaz",value:"Občanský průkaz není platným dokladem pro vstup do Džibutska. Pro vstup je nutné mít platný cestovní pas.",date_update:a},{name:"Cestovní pas",value:"Pro vstup do Džibutska je nutné mít platný cestovní pas. Platnost pasu musí být minimálně 6 měsíců od data vstupu do země.",date_update:a},{name:"Vízum",value:"Pro vstup do Džibutska je potřeba mít vízum. Vízum je nutné získat předem na ambasádě Džibutska v zemi, kde má žadatel trvalý pobyt. Vízum lze získat i na hraničním přechodu, nicméně není to doporučené a může to trvat mnohem déle.",date_update:a},{name:"Očkování",value:"Při vstupu do Džibutska není vyžadováno očkování proti žádným nemocem. Nicméně je doporučeno očkování proti žluté zimnici a hepatitidě A a B. Důležité je mít také platné očkování proti břišnímu tyfu a tetanu.",date_update:a},{name:"Cestovní pojištění",value:"Cestovní pojištění není povinné, ale je doporučeno mít ho uzavřené, zejména z důvodu vysokých nákladů na zdravotní péči v Džibutsku.",date_update:a},{name:"Bezpečnostní situace",value:"V Džibutsku se vyskytují bezpečnostní rizika v podobě teroristických útoků, především v oblasti hranice s Somálskem. Doporučuje se být ostražitý a informovat se o aktuální bezpečnostní situaci před cestou do této oblasti.",date_update:a},{name:"Další informace",value:"V Džibutsku se doporučuje respektovat místní zvyklosti a tradice, zejména v náboženských oblastech. Důležité je dodržovat zákazy alkoholu a drog, stejně jako zakázané sexuální praktiky. Vzhledem k teplému a suchému podnebí je také důležité dodržovat dostatečný přísun tekutin a chránit se před slunečním zářením.",date_update:a}],type_place:m,id_image_cover:g,id_image_hero:g,id_city_main:548,affiliate:[{name:"booking",value:c}],mpz:"DJ",alerts:[],zoom:[{google:n,booking:n}],ids_neighboring_countries:[{id:67},{id:69},{id:206}],organization:[],apps:[],links:[],information_author:[],seo_tags:[],language_phrases:[],wall_sockets:b,id:58,facts_place:b,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2024-02-10T00:28:20.01422+00:00",name_original:b,currency:[{code:"DJF",name:"džibutský frank"}]}],imagePlace:[{id:g,name:j,source:"\u002Fworld\u002Fstates\u002F",type:m,author:"pixabay.com",created_at:"2023-05-02T18:49:47.851894+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:e,slug:"afrika",name:"Afrika",area:30370000,population:1340000000,population_density:44.12,number_states:54,information_chatgpt:"\u003Cp\u003EAfrika je největší kontinent na Zemi a rozkládá se na ploše přesahující 30 milionů kilometrů čtverečních. Nachází se zde více než 50 zemí a žije zde více než 1,3 miliardy lidí. \u003C\u002Fp\u003E\n\u003Cp\u003EJižní Afrika, Egypt, Maroko a Keňa patří mezi nejoblíbenější turistické cíle v Africe. V Jihoafrické republice se můžete podívat na slavné Krugerův národní park a sledovat zde život zvířat v jejich přirozeném prostředí. Egypt je zase proslulý svými pyramidami, které se nacházejí v Gíze. V Maroku můžete navštívit tradiční trhy, zatímco v Keni se můžete setkat s Masajským kmenem a podívat se na úžasnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má bohatou historii a kulturu. První lidé, kteří se usadili v Africe, byli loveckým a sběračským národem. Poté se v této oblasti objevily první civilizace, jako je Kúšská říše, Egyptská říše nebo Království Aksum. Afrika byla také kolonizována evropskými mocnostmi a toto období mělo značný dopad na dnešní politickou situaci na kontinentu.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité zmínit, že Afrika má velké množství jazyků a kultur. Zahrnuje mnoho různých národů a etnických skupin, a to má vliv na různorodost obyvatelstva a kultury. Nejrozšířenějším jazykem je arabština, která se mluví především v severní Africe a v některých částech západní Afriky. Dalšími důležitými jazyky jsou svahilština, francouzština, portugalština, angličtina a mnoho dalších.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má také nádhernou přírodu. Nachází se zde nejvyšší hora světa, Kilimandžáro, která se nachází na území Tanzanie a Keňy. Kromě toho se v Africe nachází také největší pouště na světě, Sahara, a největší prales, Kongský prales. Na tomto kontinentě můžete vidět také mnoho zvířat, jako jsou sloni, lvi, gepardi, zebry a mnoho dalších druhů. V Africe se také nachází několik nejvýznamnějších řek světa, jako je Nil, Kongo, Niger a Zambezi.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je bohužel také známá pro své problémy. Mnoho zemí se potýká s chudobou, nedostatkem potravin a vody, nemocemi a válečnými konflikty. Mnoho afrických zemí závisí na zemědělství a rybolovu, což však často není dostatečně výnosné, aby zabezpečilo potřeby obyvatelstva. Kromě toho jsou některé země v Africe trvale postižené extrémními přírodními katastrofami, jako jsou sucha, povodně a bouře.\u003C\u002Fp\u003E\n\u003Cp\u003ENa druhou stranu se v Africe také nachází mnoho lidí, kteří se snaží změnit situaci a zlepšit životy svých spoluobčanů. Vznikají neziskové organizace, které se snaží pomáhat při řešení těchto problémů a zlepšovat kvalitu života v mnoha afrických zemích. Zároveň se v posledních letech objevují nové možnosti pro ekonomický růst a rozvoj, jako jsou technologické start-upy a zahraniční investice.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika je fascinující kontinent, který nabízí mnoho zážitků a zároveň v sobě ukrývá mnoho výzev. Pokud se rozhodnete navštívit Afriku, můžete se těšit na krásnou přírodu, bohatou kulturu a nezapomenutelné zážitky. Je však také důležité být obezřetný a připravený na místní podmínky, protože některé oblasti mohou být nebezpečné kvůli konfliktům nebo zločinnosti.\u003C\u002Fp\u003E",coordinates:[{latitude:1.650801,longitude:17.371642}],type_place:"continent",id_image_cover:e,id_image_hero:e,zoom:[{google:i,booking:h}],information_author:b,seo_tags:b,created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2023-12-27T17:07:06.531847+00:00",name_original:b}]}],fetch:{},mutations:[]}}("05-2023",null,true,0,5,200,238,3,2,"dzibutsko",500,"18","state",8)));